import {Helmet} from "react-helmet";
const Brochers = () =>{
    return(
       <>
          <Helmet>         
			<title>Arizona Resources - Acclaimed Home Warranty : Acclaimed Home Warranty</title>
			<meta name="description" content="ORDER NOW - Acclaimed Home Warranty" />
        </Helmet>
        <h1>Brochers Page</h1>
       </>
    )
};
export default Brochers;
